(13, 'Donation Management Information System', 'donation-management-information-system', 1, '<p>Donation Management Information System</p>', '-', 'Donation Management Information System', 'Donation Management Information System – A comprehensive platform for managing and tracking donations efficiently. Streamline donation processes, monitor contributions, and generate insightful reports with ease.', 'SUCCESS', 1, 1, 'project/xTdJmIcfkT64iYoFGBJlpFAEX1Nz8LrJ9xjV6vZr.png', '2025-02-11 22:10:17', '2025-02-11 22:10:17', 'Donation Management Information System a comprehensive platform for managing and tracking donations efficiently. Streamline donation processes, monitor contributions, and generate insightful reports with ease.'),
